import React from "react";
import Fade from "react-reveal/Fade";
import photo from "./../../assets/profile_photo.jpg";
import { colors } from "../../styling/colors";
import NavArrowDown from "../miscellaneous/NavArrowDown";
import NavArrowUp from "../miscellaneous/NavArrowUp";

function AboutMe({
  scrollDown,
  scrollUp,
  tooltipDown,
  tooltipUp,
  id
}) {
    return (
        <div 
          className="full_section"
          style={{ backgroundColor: colors.grey }}
          id={id}
        >
          <div className="aboutme_left" style={{ color: colors.green }}>
            <div 
              className="section_main_content"
            >
              <NavArrowUp scrollUp={scrollUp} tooltipUp={tooltipUp}></NavArrowUp>
                <img
                  src={photo}
                  alt="Profile Photo"
                  style={{
                    borderRadius: "50%",
                    border: "5px solid black",
                    maxwidth: "20%",
                    height: "auto",
                  }}
                >
                </img>
              <NavArrowDown scrollDown={scrollDown} tooltipDown={tooltipDown}></NavArrowDown>

            </div>
          </div>
          <div className="aboutme_right">
            <h1> About Me Section </h1>
          </div>

        </div>
    )
}

export default AboutMe
